import React, { Component } from 'react';
import { connect } from "react-redux";

class FibonacciCounter extends Component {
    render() {
      return (
          <div>Tests 123</div>
      );
    }
  }

  const mapStateToProps = (state) => {
    return {
        counter: state.counter
    };
  }

  export default FibonacciCounter;
